column8:
大好評の２ステージショックセンサーが更に進化して新登場！<BR><BR>
マフラー音やトラック振動への耐性が一段と高まりました。<BR>
さらに、警告感度と警報感度が別々に設定できる独立感度調整式なので、よりきめの細かい感度調整をお望みの方へおすすめです。<BR>
消費電流も4ｍAとこれまでの２０％カットを実現しました。車にやさしく、高感度＆高信頼性で誤報がきわめて少ない究極のセンサーです！
<BR><BR>
■本体仕様
<BR>本体サイズ：52x42x20mm
<BR>消費電流： 約4mA
<BR><BR>

※本製品を接続する場合はセンサー分岐ユニットSB-03が必要です。SB-03を使用しない場合は配線加工（4本）が必要です。<BR>
※マルチプレックスとは感知した強弱を識別し警告・警報を別々のパルス信号で出力する機能です。<BR>
※センサーは使用する場所における様々な環境ノイズによって失報する場合があります。近所迷惑にならないよう必要以上に感度を上げすぎず、使用環境に合わせた適度な感度設定でご利用下さい。<BR>
※ショックセンサー、超音波センサー、レーダーセンサーを組み合わせて使用する場合、電波干渉により誤作動する可能性があります。　説明書をよくお読みの上、設置に十分ご注意ください。<BR>
<BR>
<font size=-1>VIPERやその他メーカーのカーセキュリティにご使用頂く場合はカプラーの形状が異なるので加工が必要です。ご注意ください。</font>

<P>
